const Geolocation = () => {

        navigator.geolocation.getCurrentPosition(function(position) {
            console.log(position);
        },
        function(error) {
            console.error("Error Code = " + error.code + " - " + error.message);
        }
        );
    

        return (
            <div>

            </div>
        );

};

export default Geolocation;
